	<style>
		* {
			box-sizing: border-box;
		}
		
		html, body {
			background: #FFF;
			margin: 0;
			padding: 0;
			font-family: sans-serif;
			font-size: 17px;
			color: #222;
		}
		
		table {
			width: 650px;
			margin: 0 auto;
		}
		
		th:nth-of-type(1),
		td:nth-of-type(1){
			max-width: 500px;
		}
		
		th:nth-of-type(2) h3 {
			margin-bottom: 0;
		}
		
		th {
			text-align: left;
			vertical-align: center;
			background: #F5F5F5;
			padding: 10px;
		}
		
		td {
			padding: 5px 10px;
		}
		
		th span {
			font-weight: normal;
			text-transform: uppercase;
			font-size: 11px;
			opacity: 0.7;
		}
		
		h3 {
			margin-top: 0;
		}
		
		.id {
			padding-top: 40px;
			color: #999;
			font-size: 11px;
			font-family: monospace; 
		}
		
		#content {
			width: 650px;
			margin: 40px auto 0;
		}
		
		#search {
			border: none;
			background: #F5F5F5;
			padding: 8px 16px;
			font-size: 18px;
			border-radius: 3px;
			width: 100%;
		}
		
		#content > p {
			line-height: 24px;
		}
		
		.hide {
			display: none;
		}
	</style>
</head>

		let dom = '<table>'
		for(key of Object.keys(pricelist)) { 
			dom += `<tbody>
						<tr>
							<td colspan="2">
								<div class="id">${pricelist[key]['id']}</div>
							</td>
						</tr>
						<tr>
							<th>
								<h3>${key}</h3>
							</th>
							<th>
								<h3>${pricelist[key]['averageCharge']} <span style="position: relative; top: -3px; font-size: 10px;">(avg)</span></h3>
								<span class="min">Min: ${pricelist[key]['deidentifiedMinimum']}</span>
								<span class="max">Max: ${pricelist[key]['deidentifiedMaximum']}</span>
							</th>
						</tr>`
			
			for(item of Object.keys(pricelist[key])) {
				if(['id', 'averageCharge', 'deidentifiedMinimum', 'deidentifiedMaximum'].indexOf(item) == -1) {					
					dom += `<tr>
								<td>${item}</td>
								<td>${pricelist[key][item]}</td>
							</tr>`
				}
			}
			
			dom += '</tbody>'			
		}
		
		dom += '</table>'
		document.body.insertAdjacentHTML('beforeend', dom)
		
		search.onkeyup = e => {
			if(search.value.length > 2) {
				;[...document.querySelectorAll('th:nth-of-type(1), td:nth-of-type(1)')]
					.map(l => {
						l.closest('tr').classList.remove('hide')
						return l
					})
					.filter(l => {
						return (l.textContent.toLowerCase().indexOf(search.value.trim().toLowerCase()) == -1)
					})
					.map(l => {
						l.closest('tr').classList.add('hide')							
					})
				
				if(!([...document.querySelectorAll('tr:not(.hide) > th')].length)) {
					console.log('unhiding headers...')
					
					;[...document.querySelectorAll('tr:not(.hide) > td')]
						.map(l => {
							l.closest('tbody')
								.querySelector('th')
								.parentElement
									.classList.remove('hide')
						}) 
				}
			}
		}
	</script>
